import React, { useState } from 'react';
import { motion } from 'framer-motion';
import ProjectCard from '../components/ProjectCard';

const Projects = () => {
  const [projects, setProjects] = useState([
    {
      _id: '1',
      title: 'Brain Tumour Detection Using Deep Learning',
      description:
        'Deep learning web app for rice pest detection (Konkan region) using YOLOv8 & ResNet-152V2, achieving 83.4% accuracy with multilingual diagnosis and control guidance.',
      technologies: ['Deep Learning', 'Flask', 'Python'],
      imageUrl: 'data:image/jpeg;base64,',
      githubUrl: 'https://github.com/vatsalk18/brain_tumor_detection',
      featured: true,
    },
    {
      _id: '2',
      title: 'Life Insurance Recommendation System',
      description:
        'Decision Tree-based recommendation system with Flask, featuring admin dashboard and CRUD operations across SQLite databases.',
      technologies: ['Flask', 'Decision Tree', 'SQLite', 'Python'],
      imageUrl: 'data:image/png;base64,',
      githubUrl: 'https://github.com/vatsalk18/life-insaurance-recommendtion-system',
      featured: true,
    },
    {
      _id: '3',
      title: 'Deep Learning-Based Pest Classification for Precision Agriculture',
      description:
        'Rice pest classification system using YOLOv8 and ResNet-152V2, achieving 83.4% accuracy with multilingual diagnosis and pest control guidance.',
      technologies: ['YOLOv8', 'ResNet-152V2', 'Flask', 'Python', 'Deep Learning'],
      imageUrl: 'data:image/jpeg;base64,',
      githubUrl: 'https://github.com/vatsalk18/Pest-Identitfication-and-Classification',
      featured: true,
    },
    {
      _id: '4',
      title: 'Automobile Auction',
      description:
        'Full-stack web application for online automobile auctions with real-time bidding system and admin dashboard.',
      technologies: ['HTML', 'CSS', 'JavaScript', 'PHP'],
      imageUrl: 'data:image/jpeg;base64,',
      githubUrl: 'https://github.com/vatsalk18/automobile-auction-system',
      featured: true,
    },
  ]);

  const [filter, setFilter] = useState('all');

  const categories = ['all', 'Python', 'Flask', 'Deep Learning', 'Computer Vision', 'PHP', 'JavaScript'];

  const filteredProjects =
    filter === 'all'
      ? projects
      : projects.filter((p) => p.technologies.some((t) => t.includes(filter)));

  const container = {
    hidden: { opacity: 0 },
    show: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
      },
    },
  };

  return (
    <div className="pt-24">
      {/* Hero */}
      <section className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-12 text-center">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <h1 className="text-5xl font-bold mb-4">
            My <span className="gradient-text">Projects</span>
          </h1>
          <p className="text-xl text-slate-300 max-w-2xl mx-auto">
            A collection of my latest projects showcasing my skills in various technologies
          </p>
        </motion.div>
      </section>

      {/* Filter */}
      <section className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <motion.div
          initial={{ opacity: 0, y: 10 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="flex flex-wrap gap-3 justify-center"
        >
          {categories.map((cat) => (
            <button
              key={cat}
              onClick={() => setFilter(cat)}
              className={`px-6 py-2 rounded-lg font-semibold transition-all duration-300 ${
                filter === cat
                  ? 'bg-gradient-to-r from-blue-500 to-purple-600 text-white'
                  : 'glass text-slate-300 hover:text-blue-400'
              }`}
            >
              {cat.charAt(0).toUpperCase() + cat.slice(1)}
            </button>
          ))}
        </motion.div>
      </section>

      {/* Projects Grid */}
      <section className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 pb-20">
        <motion.div
          variants={container}
          initial="hidden"
          animate="show"
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6"
        >
          {filteredProjects.map((project) => (
            <ProjectCard key={project._id} project={project} />
          ))}
        </motion.div>

        {filteredProjects.length === 0 && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="text-center py-20"
          >
            <p className="text-2xl text-slate-400">No projects found in this category</p>
          </motion.div>
        )}
      </section>
    </div>
  );
};

export default Projects;
